export default function Pizza({ name, ingredients, photoName, price }) {
	return (
		<div>
			<img src={photoName} alt="Spinaci Pizza Photo" />
			<h3>{name}</h3>
			<p>{ingredient}</p>
			<p>{price}</p>
		</div>
	);
}
